import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

import Users from "./pages/Users";
import Add from "./pages/Add";
import Update from "./pages/update";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
        <Route path="/" element={<Users/>}/>
        <Route path="/add" element={<Add/>}/>
        <Route path="/update" element={<Update/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
